import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function NavigationItems() {

    return (
        <Container  style={{backgroundColor: "red"}}>
            <Row>
                <Col>1</Col>
            </Row>
            <Row>
                <Col>1</Col>
            </Row>
            <Row>
                <Col>1</Col>
            </Row>
            <Row>
                <Col>1</Col>
            </Row>
        </Container>
      );
}

export default NavigationItems;
